import React from 'react';
import './post.css';

const Post = (name) => {
  return (
    <div className='post'>
      <div className='post-c1'>
        <p>@{name="Rohit"}</p>
      </div>
      <div className='post-c2'>
        <img src='' alt='post'></img>
      </div>
      <div className='post-c3'></div>
      <div className='post-c4'>
        <a href='#comments'>Comments</a>
      </div>
    </div>
  )
}

export default Post
